            <a href=""><h1 className="text-4xl">Expense Tracker</h1></a>
            <div className='flex gap-4 items-center'>
                <span className="hover:text-blue-900 hover:scale-125"><a href="#home">Home</a></span>
                <span className="hover:text-blue-900 hover:scale-125"><a href="#features">Features</a></span>
                <span className="hover:text-blue-900 hover:scale-125"><a href="#about">About</a></span>
                <span className="hover:text-blue-900 hover:scale-125"><a href="#contact">Contact</a></span>
                <span className="hover:text-blue-900 hover:scale-125"><a href=''>Login</a></span>
            </div>
        </div>
    )
}

